import React from "react";

import '../App.css';
import '../Styles/Clock.css';


function CountDown() {
  return (
    <div>
      <div className="clock">
        <div className="flex flex-col items-center">
          <button type="button" style={{ fontSize: 65 }}>+</button>
          <div className="hour">13</div>
          <button type="button" style={{ fontSize: 65 }}>-</button>
        </div>
        <div className="colon">:</div>

        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center"
          }}
        >
          <button type="button" style={{ fontSize: 65 }}>+</button>
          <div className="minute">55</div>
          <button type="button" style={{ fontSize: 65 }}>-</button>
        </div>


        <div className="colon">:</div>

        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center"
          }}
        >
          <button type="button" style={{ fontSize: 65 }}>+</button>
          <div className="minute">20</div>
          <button type="button" style={{ fontSize: 65 }}>-</button>
        </div>
      </div>
    </div>
  );
}



export default CountDown;
